import sql from "mssql";

const dbSettings = {
    user: "Jhonn",
    password : "qwerty",
    server : "localhost",
    database: "hospital",
    options:{
        encrytp: true,
    trustServerCertificate : true
    }
}

//aca ponemos en donde esta la base de datos
export async function getConnection(){
    try{
        const pool = await sql.connect(dbSettings);
        return pool;
    }catch(error){
        console.error(error);
    }
}

